                            margin: '45px auto',
                            fontSize: '44px',
                            fontWeight: '400',
                        }}
                    >
                        Log in
                    </p>
                    <p>
                        Youâ€™ll be logged in for 14 days unless you log out
                        manually.
                    </p>
                    <br />
                    <Link exact to="/HomePage">
                        {/* <Button variant="contained">Log in with Github</Button> */}
                        Loging
                    </Link>

                    <Switch>
                        <Route path="/HomePage" exact component={HomePage}/>
                    </Switch>
                </div>
            </CssBaseline>
        </BrowserRouter>
    );
};

export default Login;
